    <h2 {...{
      "id": "setting-up-the-development-environment"
    }}>{`Setting up the development environment`}</h2>
    <p>{`If you haven't setup your development environment. Let's go through a small step-by-step tutorial to get started with your Docusaurus project.`}</p>
    <div {...{
      "className": "admonition admonition-note alert alert--secondary"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
