      "id": "step-1--generate-a-docusaurus-site"
    }}>{`Step 1:  Generate a Docusaurus site`}</h3>
    <p>{`Let's run a command to generate the classic template. You can run this command anywhere either in a new empty repository or within an existing repository.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-shell"
      }}>{`npx @docusaurus/init@latest init my-documentation classic
`}</code></pre>
