      "id": "step-2-start-your-docusaurus-site"
    }}>{`Step 2: Start your Docusaurus site`}</h3>
    <p>{`Run this command to start the Docusaurus development server and start developing by adding content to your docusaurus project: `}</p>
    <pre><code parentName="pre" {...{
        "className": "language-shell"
      }}>{`npx docusaurus start
`}</code></pre>
    <p>{`Open up `}<inlineCode parentName="p">{`getting-started.md`}</inlineCode>{` in your project folder and try to edit some lines. The site should reload automatically after you save your changes.`}</p>
